import React from 'react';
import PropTypes from 'prop-types';
import './DataCards.scss';

const DataCards = props => {
  const { cardData, actions } = props;
  console.log("Checking card:", cardData, actions);

  const cards =
  cardData &&
  cardData instanceof Array &&
  cardData.map(depart => {
      return (
        <div className="col col-12 col-lg-4 col-md-6 mb-3">
          <button
            className="btn h-100  w-100 p-3  border data-card  "
            onClick={() => actions.onComponent}
          >
            <div className="card-title">{depart.title}</div>
            {depart.body}
          </button>
        </div>
      );
    });
  return <div className="row cards">{cards}</div>;
};

DataCards.propTypes = {
  cardData: PropTypes.object
};

DataCards.defaultProps = {
  cardData: {}
};

export default DataCards;
